  false,\n\t\"url\": null,\n\t\"notes\": \"Oceanographic data were collected along
  predetermined transects in the American Samoa EEZ.  CTD cats were conducted at predetermined
  stations.  CTDs were equipped with oxygen sensors and fluorometers, and chlorophyll
  and nutrients were measured at discrete depths.  Biological backscatter were monitored
  using the EK60 echosounder system (38, & 120 kHz) along the transects.  Currents
  were continuously recorded using an RD Instruments Acoustic Doppler Current Profiler
  (ADCP).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
